import React from "react";

function ImagePopup({ card, onClose, cards }) {
    const className = `${card ? 'popup_opened' : '' }`;


    return (
<>
      {cards.map((item) => (
        <div className={`popup popup_type_more-image ${className}`}>

       <div key={item.id} className="popup__container-image">
        <img src={item.link} className="image" alt="Фото" />
        <button type="reset" className="popup__close" onClick={onClose}></button>
        <p className="popup__title-image"></p>
        </div>
        </div>

        ))}
        </>
    )
}

export default ImagePopup;


